postcontent:
Very interested in what you might offer in trade for this brass. You might want to be ready for the next ammo shortage. It has not been cleaned. No photos since you probably know what uncleaned brass looks like. I will ship these at my expense to whoever buys all of it.

9mm - 800 cases, 5 cents each;
.45ACP - 500 cases, 7 cents each;
.223 mixed with some Lake City 5.56 - 300 cases, 9 cents each;
.308 - 14 cases, 10 cents each;
.40 S&W - 110 cases, 5 cents each;
.380ACP - 60 cases, 6 cents each;
.38 special - 35 cases, 6 cents each;
.357 magnum - 10 cases, 9 cents each.
Call, text or email. (7 ate 5) 55zeero - 733zeero.
